import styled from 'styled-components';

export const Container = styled.View`
  flex: 1;
`;

export const Header = styled.View`
  flex: 0.7;
  background: #1C1C30;
  flex-direction: column;
`;

export const ViewCreateCustomer = styled.View`
  margin-top: 15;
  align-items: center;
  margin-top: 35;
`;

export const ButtonCreateCustomer = styled.TouchableOpacity`
  background: green;
  align-items: center;
  flex-direction: row;
  border-radius: 10;

`;

export const TitleCreateCustomer = styled.Text`
  font-size: 19;
  margin-left: 5;
  color: white;
`;

export const Footer = styled.ScrollView`
  flex: 2;
  background: #DCDCDC;
`;

export const Title = styled.Text`
	text-align: center;
	margin-top: 20;
  font-size: 20;
  color: white;
`;

export const ListCustomers = styled.FlatList``;
